import "./App.css";
const bootstrap = require("bootstrap");

function App() {
  return (
    <div className="App">
      <header className="App-header">
        Thomas and Sharon's Initiative Tracker
      </header>
      <body>
        <div className="grid">
          <div className="row">
            <input name="initiative" />
            <input name="charactername" />
            <input name="movement" />
            <input name="hp" />
            <input name="ac" />
            <input name="conditions" />
          </div>
        </div>
      </body>
    </div>
  );
}

export default App;
